import styled from "styled-components";
import React from "react";
import Slider from "react-slick";

export default function SectionProject() {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Container>
      <Slider {...settings}>
        <TextBannerWrap>
          <TextBanner>KEEP GOING</TextBanner>
        </TextBannerWrap>
        <TextBannerWrap>
          <TextBanner>KEEP GOING</TextBanner>
        </TextBannerWrap>
        <TextBannerWrap>
          <TextBanner>KEEP GOING</TextBanner>
        </TextBannerWrap>
        <TextBannerWrap>
          <TextBanner>KEEP GOING</TextBanner>
        </TextBannerWrap>
        <TextBannerWrap>
          <TextBanner>KEEP GOING</TextBanner>
        </TextBannerWrap>
      </Slider>
    </Container>
  );
}

const Container = styled.div`
  width: 100%;
`;
const TextBannerWrap = styled.div`
  height: 300px;
  background-color: red;
  position: absolute;
  top: 0;
  left: 0;
`;

const TextBanner = styled.h3`
  margin: 40px 70px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
  color: #000;
`;
